webpackJsonp([0xd1d5490b7760],{325:function(A,a){A.exports={data:{markdownRemark:{html:'<p>I’m Ismail Ghallou also known as Smakosh, a nickname which was given to me since I was 8 years old by my friend’s dad, many told me that I was a good student when I was at primary school &#x26; thanks to video games and to my dad for buying our first pc ever &#x26; also some anime I was watching at that time, then I decided to get into a public schools rather than a private school on the last year of primary school, at that time I got addicted to Basketball though I was a good player, specially in the streets(and1), here’s a picture of some medals I got from some tournaments I &#x26; my friends won on Football &#x26; Basketball.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/medals-b49e3ba3b1f87e30a80445459392fb02-5025c.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1080px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="medals"\n        title="Follow me on Instagram to see more : https://www.instagram.com/smakosh19"\n        src="/static/medals-b49e3ba3b1f87e30a80445459392fb02-5025c.jpeg"\n        srcset="/static/medals-b49e3ba3b1f87e30a80445459392fb02-097a5.jpeg 270w,\n/static/medals-b49e3ba3b1f87e30a80445459392fb02-d02ea.jpeg 540w,\n/static/medals-b49e3ba3b1f87e30a80445459392fb02-5025c.jpeg 1080w"\n        sizes="(max-width: 1080px) 100vw, 1080px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>During secondary school I started exploring more hobbies like drawing, graffiti, biking &#x26; skateboarding and I was still getting good marks though, at high school I got addicted to Parkour &#x26; Free running and it was really a good experience “to not be able to do a backflip then after a long period of training (even though there were no gyms) to actually do it ” it was something really amazing, I spent like 2 years practicing and have recorded some videos right <a href="https://www.instagram.com/smakosh19">here</a>.</p>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.25%; position: relative; height: 0; overflow: hidden;margin-bottom: 1.0725rem"\n          >\n            <div class="responsive-video">\n    <iframe src="https://www.youtube.com/embed/bujbKsEKZ-4" frameborder="0" allow="encrypted-media" allowfullscreen style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n</div>\n          </div>\n          </div>\n<p>During the last year of high school I got a gaming pc which my dad bought for me since I asked a lot for it, specially for gaming &#x26; it made me get addicted to gaming and so I graduated from high school with bad marks but yeah I got accepted in some sort of school which is equivalent to university &#x26; at that moment everything has changed, I started teaching myself at home, learning, practicing by doing side projects &#x26; working as a free lancer from november 2015 until now, I taught myself Graphic, UI/UX design, programming &#x26; web development (front end &#x26; back end), restudied maths — algebra linear, calculus, probabilities… — &#x26; now i’m still learning specially about machine &#x26; deep learning specially neural networks &#x26; willing to create some web &#x26; mobile apps based on Artificial intelligence to help people.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/setup-bd72794c24650c8815b660924baaf96f-6d09e.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1080px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="my setup"\n        title="My Setup"\n        src="/static/setup-bd72794c24650c8815b660924baaf96f-5025c.jpeg"\n        srcset="/static/setup-bd72794c24650c8815b660924baaf96f-097a5.jpeg 270w,\n/static/setup-bd72794c24650c8815b660924baaf96f-d02ea.jpeg 540w,\n/static/setup-bd72794c24650c8815b660924baaf96f-5025c.jpeg 1080w,\n/static/setup-bd72794c24650c8815b660924baaf96f-66465.jpeg 1620w,\n/static/setup-bd72794c24650c8815b660924baaf96f-7862b.jpeg 2160w,\n/static/setup-bd72794c24650c8815b660924baaf96f-6d09e.jpeg 2592w"\n        sizes="(max-width: 1080px) 100vw, 1080px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>I actually <a href="/never-work-for-free">Got a job offer</a> at a start up after completing one month paid internship which I declined since I graduated and willing to pursue my studies, I declined to too many other offers later on. I’m more interested in launching a start up!</p>\n<p>you can view all my works on my website <a href="http://smakosh.com">http://smakosh.com</a> &#x26; more down bellow :</p>\n<ul>\n<li>Behance: <a href="https://www.behance.net/ismail16sm9991">https://www.behance.net/ismail16sm9991</a></li>\n<li>Github: <a href="https://github.com/smakosh">https://github.com/smakosh</a></li>\n<li>Instagram: <a href="https://www.instagram.com/smakosh19">https://www.instagram.com/smakosh19</a></li>\n<li>Twitter: <a href="https://twitter.com/smakosh">https://twitter.com/smakosh</a></li>\n<li>Facebook: <a href="https://www.facebook.com/Ismailghallou">https://www.facebook.com/Ismailghallou</a></li>\n<li>Youtube: <a href="https://www.youtube.com/user/smakoshthegamer">https://www.youtube.com/user/smakoshthegamer</a></li>\n<li>Dribbble: <a href="https://dribbble.com/smakosh">https://dribbble.com/smakosh</a></li>\n<li>LinkedIn: <a href="https://www.linkedin.com/in/ismail-ghallou-630149122">https://www.linkedin.com/in/ismail-ghallou-630149122</a></li>\n<li>Codepen: <a href="https://codepen.io/Smakosh">https://codepen.io/Smakosh</a></li>\n<li>Creative market: <a href="https://creativemarket.com/Smakosh">https://creativemarket.com/Smakosh</a></li>\n</ul>\n<p>And if you want to support me on Patreon, That would be helpful to my hosting :D <a href="https://www.patreon.com/smakosh">https://www.patreon.com/smakosh</a></p>',timeToRead:3,frontmatter:{date:"December 02, 2016",edited:null,path:"/about-me-so-far",title:"About me so far...",next:"/istanbul-trip",id:0,thumbnail:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.3333333333333333,src:"/static/setup-bd72794c24650c8815b660924baaf96f-f2ac0.jpeg",srcSet:"/static/setup-bd72794c24650c8815b660924baaf96f-567e3.jpeg 158w,\n/static/setup-bd72794c24650c8815b660924baaf96f-c3206.jpeg 315w,\n/static/setup-bd72794c24650c8815b660924baaf96f-f2ac0.jpeg 630w,\n/static/setup-bd72794c24650c8815b660924baaf96f-0c4a5.jpeg 945w,\n/static/setup-bd72794c24650c8815b660924baaf96f-211f3.jpeg 1260w,\n/static/setup-bd72794c24650c8815b660924baaf96f-0150a.jpeg 1890w,\n/static/setup-bd72794c24650c8815b660924baaf96f-133d5.jpeg 2592w",sizes:"(max-width: 630px) 100vw, 630px"}}}}}},pathContext:{}}}});
